    <title>Vildosola Racing</title>

    <script type="text/javascript">
        var x = 0;
        $(document).ready(function () {
            initialize();
            drawRoute();
            drawMiles();
            BindPos();
        });

        function timer() {
            BindPos();
        }

        function initialize() {
            var latlng = [31.029202, -114.854636];

            $('#my_map').gmap3({
                map: {
                    options: {
                        center: latlng,
                        zoom: 14,
                        mapTypeId: google.maps.MapTypeId.SATELLITE,
                        mapTypeControl: true,
                        mapTypeControlOptions: {
                            style: google.maps.MapTypeControlStyle.DROPDOWN_MENU
                        },
                        navigationControl: true,
                        scrollwheel: true,
                        streetViewControl: false
                    },
                    autofit: {}
                }
            });
            var map = $('#my_map').gmap3("get");
            var centrarmapaDiv = document.createElement('div');
            var centrarControl = new centrarmapa(centrarmapaDiv,map);
            centrarmapaDiv.index = 1;
            map.controls[google.maps.ControlPosition.TOP_RIGHT].push(centrarmapaDiv);

            google.maps.event.addDomListener(window, 'resize', function () {
                var center = map.getCenter();
                google.maps.event.trigger(map, "resize");
                map.setCenter(center);
            });
        }

        function centrarmapa(controlDiv,map) {

            // Set CSS styles for the DIV containing the control
            // Setting padding to 5 px will offset the control
            // from the edge of the map
            controlDiv.style.padding = '5px';

            // Set CSS for the control border
            var controlUI = document.createElement('div');
            controlUI.style.backgroundColor = 'white';
            controlUI.style.borderStyle = 'solid';
            controlUI.style.borderWidth = '1px';
            controlUI.style.cursor = 'pointer';
            controlUI.style.textAlign = 'Miles';
            controlUI.title = 'show/hide miles';
            controlDiv.appendChild(controlUI);

            // Set CSS for the control interior
            var controlText = document.createElement('div');
            controlText.style.fontFamily = 'Arial,sans-serif';
            controlText.style.color = 'black';
            controlText.style.fontSize = '12px';
            controlText.style.paddingLeft = '4px';
            controlText.style.paddingRight = '4px';
            controlText.innerHTML = 'Show/Hide miles';
            controlUI.appendChild(controlText);

            // Setup the click event listeners: simply set the map to
            google.maps.event.addDomListener(controlUI, 'click', function () {
                if (x == 0) {
                    x = 1;
                    clearMarker('overlay');
                }
                else if (x == 1) {
                    x=0;
                    drawMiles();
                }
            });

        }

        function clearMarker(idtag) {
            console.log(idtag);
            $('#my_map').gmap3({
                clear: {
                    tag: [idtag]
                }
            });

            //$('#my_map').gmap3({
            //    get: {
            //        id: "START-FINISH",
            //        callback: function (overlay) {
            //            overlay.options= "{content: ''}";
            //        }
            //    }
            //});
        }

        function BindPos() {
            $.ajax({
                type: "POST",
                url: "race.aspx/GetPosition",
                data: "{}",
                contentType: "application/json; charset=utf-8",
                dataType: "json",
                success: function (msg) {
                    var row = "";
                    for (i = 0; i < msg.d.length; i++) {
                        var data = jsonParse(msg.d[i]);
                        createMarker(data);
                    }
                },
                complete: setTimeout(timer, 30000)
            })
        }

        function createMarker(data) {
            $('#my_map').gmap3({
                clear: {
                    id: data.IMEI,
                    id: 'o' + data.IMEI
                }
            });
            var fUTC = new moment('1970-01-01').add('s', data.time);//.format("MM/DD/YYYY HH:mm:ss");
            var dUTC = moment().add('h', 8);//.format("MM/DD/YYYY HH:mm:ss");
            var latlng = [data.latitud, data.longitud];
            $('#my_map').gmap3({
                marker: {
                    latLng: latlng, id: data.IMEI, options: {
                        icon : "images/icon.png",
                        zIndex: 999999, optimized: true
                    }
                },
                overlay: {
                    id: 'o' + data.IMEI,
                    latLng: latlng,
                    options: {
                        content: '<div class="infobox">' +
                                  '' + dUTC.diff(fUTC, 'minutes') + ' min ago<br/>' +
                                  'Name: ' + data.nombre + '<br/>' +
                                  'Speed: ' + ~~(data.velocidad / 1.609344) + ' mph' +
                                  '</div>',
                        offset: {
                            y: -70,
                            x: 15
                        }
                    }
                }
            });
            
            $('#my_map').gmap3('get').panTo(new google.maps.LatLng(data.latitud, data.longitud));
        }
